Du skal prøve å sjekke alle indeksene fra zero på till finnes på denne array, således vil du beskrive den første indeksen som zero og den første indeksen som først efter zero. Du må sjekke alle indekser fra zero på till finnes og fjern alle indekser fra zero på till den første indeksen, der ikke er et sløret element.

```c++
bool find(const T& element, const size_t& index) {
    if (index == 0) return false;
    if (element == array[index]) return true;
    else if (index > 0)
        return find(element, index-1);
    else return false;
}```
